              <a href="#personnalite" id="personnalite"><h5 name="personnalite">Concept de personnalité</h5></a>

              <div id="para-perso" style="display: none">
                <p>Emmanuel, dans cette section, le terme personnalité décrit la manière selon laquelle une personne agit naturellement. Par exemple, certaines personnes sont naturellement très organisées et précises, alors que d’autres sont plus spontanées et informelles. De la même manière, certains osent prendre des risques alors que d’autres sont naturellement prudentes.</p>
  		<p>L’expérience et l’observation confirment qu’il n’existe pas une personnalité idéale. Toutes sont bonnes. Toutes sont nécessaires dans la société et dans le monde du travail. Toutes présentent des points forts et des points faibles.</p>
  		<p>Il est réellement important de prendre en compte votre personnalité lorsque vous prenez une décision de carrière. Le but est d’identifier les professions qui s’accordent avec vos tendances naturelles, ainsi qu’avec vos intérêts, vos compétences et vos valeurs. Tout comme les entraîneurs ont besoin d’athlètes de tailles et de vélocité différentes afin d'occuper différents postes, les employeurs ont également besoin de personnalités différentes afin de composer une équipe performante.</p>
              </div>
