              <a href="#Critere" id="Critere"><h5 name="Critere">Critères essentiels du domaine des compétences pour choisir un métier</h5></a>

              <div id="para" style="display: none">

  	<p><span class="cdreport-user">Emmanuel</span>, la connaissance de vos compétences sera importante au moment d’évaluer vos choix potentiels de métier. Il est d’une importance cruciale que vous accordiez votre travail avec vos compétences les plus fortes afin d’obtenir la satisfaction personnelle d’accomplir quelque chose qui coule de source.</p>
  	<p>Il y a deux raisons de bâtir sur vos points forts naturels. Premièrement, agir ainsi vous aidera à maximiser votre potentiel. Travailler avec vos points forts naturels vous permet de démarrer à un niveau plus élevé, d'apprendre plus rapidement et d'atteindre davantage pour le même degré d’efforts. Par exemple, certaines personnes peuvent s’entraîner au chant durant des années, mais n’arriveront jamais à devenir un chanteur renommé, tout simplement car il leur manque les compétences naturelles pour exceller.</p>
  	<p>Deuxièmement, travailler avec vos points forts naturels est simplement plus agréable. Il est prouvé que l'on est moins stressé au travail lorsqu’on utilise les compétences dans lesquelles on excelle naturellement. Logiquement, on apprécie d’utiliser ses compétences quand elles ont été reconnues, mises en valeur et récompensées par les autres par le passé. Votre confiance en vous continuera à grandir en utilisant vos compétences naturelles, ce qui vous conduira à avoir davantage de succès et de satisfaction dans l’avenir.</p>
  	<p>En résumé, vous êtes plus à même d'exceller lorsque vous utilisez les compétences qui vous viennent naturellement et qui vous font plaisir. Même s’il est important de vous souvenir de vos faiblesses, il n’est en général pas productif de rester focalisé(e) sur elles au travail. Dans vos domaines de compétences, essayez de nager avec le courant, et non pas contre.</p>
