                	<h4 class="cdreport-header cdreport-header-alt">CES ATTENTES SONT LES PLUS IMPORTANTES POUR VOUS</h4>

                		<h5><b>1. Leadership</b></h5>
                		<p>Vous vous sentez à l'aise dans des positions où vous avez la responsabilité d'autres personnes et de ressources. Vous êtes à l'aise pour assumer des responsabilités, pour donner des instructions aux autres et prendre des décisions pour le groupe. Votre travail doit impliquer la possibilité d'amener une équipe à atteindre des objectifs communs.</p>

                		<h5><b>2. Stimulation intellectuelle</b></h5>
                		<p>Vous aimez réfléchir à des problématiques complexes et utiliser vos capacités de raisonnement pour les résoudre. Dans les critères de choix de carrière, vous devez considérer la possibilité d'acquérir de nouvelles informations et d'aborder les problèmes d'un point de vue intellectuel.</p>

                		<h5><b>3. Aider les autres</b></h5>
                		<p>Il est important à vos yeux que vous puissiez contribuer au développement et au bien-être des autres. C'est quelque chose qui doit faire intégralement partie de votre travail. Vous pouvez le faire au travers de la formation, de l'enseignement, du conseil, du soutien ou de l'aide financière. Votre choix de métier doit vous permettre d'exprimer votre souci des autres.</p>

                		<h5><b>4. Formation continue</b></h5>
                		<p>Vous aimez grandir et gagner en séniorité dans votre champ professionnel. Pour vous, il est important que vous ayez des opportunités de formation complémentaire de séminaires ou d'accès à un enseignement plus formel. Recherchez des opportunités de travail qui mettent en avant le développement personnel par une formation continue, sous une forme ou une autre.</p>

