              	<p>Ce domaine est important dans la planification de carrière car de nombreuses personnes ont de la difficulté à mettre en accord leur manière de vivre et de travailler avec leurs valeurs de vie. Un rythme de vie effréné, les pressions des engagements financiers et la complexité de la vie à notre époque amènent beaucoup à penser qu'ils ne font que survivre chaque jour.</p>
              	<p>Toutefois, certains prennent le temps de définir un but pour leur vie et, suite à cela, ont fait des choix de carrière qui contribuent à ce but. L’expérience montre que ces personnes ont un sens d’accomplissement et de paix en ce qui concerne leur travail. Sur la page suivante, concentrez-vous sur vos quatre points les plus importants en ce qui concerne votre objectif de vie.</p>

