              	<h4 class="cdreport-header cdreport-header-alt">CI-DESSOUS SONT LISTES VOS QUATRE PRIORITES DE VIE LES PLUS IMPORTANTES</h4>

              		<h5><b>1. Servir Dieu</b></h5>
              		<p>Vous avez indiqué que le but de votre vie est de servir Dieu dans tout ce que vous faites. Il sera très important que vous puissiez voir comment votre travail va contribuer à cet objectif. Souvenez-vous que tous les métiers offrent des possibilités de Le servir. La bonté, et l'engagement pour l'excellence, sont des moyens d'attirer d'autres à Lui sur votre lieu de travail.</p>

              		<h5><b>2. Intégrité</b></h5>
              		<p>L'honnêteté dans tous les domaines de la vie est une valeur essentielle pour vous. Vous vous appliquez à tout faire pour honorer vos engagements et pour répondre aux critères les plus élevés d'honnêteté et de vérité. Afin de vous assurer que vous n'ayez pas à compromettre votre intégrité, prenez le temps d'évaluer attentivement l'environnement de travail et la direction, ainsi que les produits et les services de toute entreprise pour laquelle vous envisagez de travailler. &nbsp;</p>

              		<h5><b>3. Famille</b></h5>
              		<p>Votre famille a beaucoup d'importance pour vous et vous souhaitez pouvoir prendre soin des vôtres dès qu'ils ont besoin de vous. Etre disponible pour eux et impliqué(e) dans leurs activités compte beaucoup pour vous. Le fait d'avoir suffisamment de temps de qualité en famille est important pour vous et cela doit être pris en considération dans vos choix professionnels.</p>

