                	<a name="Conclusion"></a><h4 class="cdreport-header">4.4: Valeurs: Conclusion</h4>
                    <h4 class="cdreport-header cdreport-header-alt"> TROUVEZ LE BON EQUILIBRE DANS VOS VALEURS </h4>
                    <p> Personne n’est parfait, Superman et Wonder-Woman n’existent pas et vous ne pourrez jamais faire tout ce que vous aimeriez au niveau que vous le voudriez. Tout le monde doit trouver son équilibre dans la vie. Le fait d’établir vos priorités vous permettra de trouver un équilibre entre la manière de gérer votre temps, votre énergie et vos ressources financières. Vous référer à votre liste de priorités vous aidera à atteindre les objectifs de vies que vous vous êtes fixés. </p>

                    <h4 class="cdreport-header cdreport-header-alt"> ATTENDEZ-VOUS A CE QUE VOS VALEURS CHANGENT </h4>
                    <p> Ce sont vos priorités et vous pouvez en changer à n’importe quel moment. La plupart des gens remarquent que certaines de leurs priorités changent alors qu’ils vieillissent ou que leur situation familiale change. Il peut être intéressant de conserver ce rapport pour y revenir dans le futur. Une évaluation périodique vous permettra de faire des mises à jour et de voir si vous avez réussi à rester fidèle à vos priorités. </p>

                	<h4 class="cdreport-header cdreport-header-alt"> QU’EST-CE QUE JE FAIS MAINTENANT? </h4>
                	<p> Comparez les étapes du développement de votre carrière avec des vacances en famille à l’autre bout du pays. Il y a deux étapes bien distinctes. La première étape consiste à faire toutes les recherches nécessaires afin de faire des vacances un temps agréable. La deuxième étape consiste à s'asseoir dans la voiture, sortir du garage et se mettre en route. </p>
                	<p> La lecture de votre rapport de CAREER DIRECT est comparable à la lecture d’un atlas routier lors de la première étape. Cela vous donne une vue d’ensemble des directions générales pour atteindre votre destination, tout en vous montrant quelques itinéraires bis qui peuvent vous y conduire. Cependant, le simple fait de lire le rapport ne va pas résoudre votre problème de carrière, pas plus que la lecture d’une carte routière ne pourrait suffire pour vous conduire à destination. </p>
                	<p> Vous passerez alors à la deuxième étape. C’est le moment d’entrer dans la voiture, de vous asseoir au volant et de démarrer votre cheminement de carrière. La première étape consiste à transformer les informations reçues en plan et en décisions qui vous permettront de démarrer. Afin de vous assister dans cette étape cruciale, nous mettons à votre disposition le Plan d’Action, qui est un guide pour interpréter et agir en fonction de ce que vous avez appris. Il est extrêmement important que vous le suiviez de A à Z. Cela vous aidera à faire correspondre votre profil avec différents métiers et programmes de formation. </p>
                	<p> Mais par-dessus tout, n’oubliez pas l’objectif de base de la planification de carrière, qui est de faire correspondre vos talents et vos intérêts avec les prérogatives de votre travail. C’est en agissant ainsi que vous obtiendrez la plus grande probabilité d’atteindre votre but, à savoir une carrière qui vous corresponde. </p>

